	return (
		<Layout home> 
			<div className={style.buttons}>
				<Link href='/about'><a>About</a></Link>
				<a href='/projecs.pdf'>Projects</a>
				<Link href='/contact'><a>Contact</a></Link>
			</div>

			<a className={style.resumeLink} 
				href='/resume.pdf'>
					Full Resume PDF
			</a>
		</Layout>
	);
}
